import React from "react";

// react-router-dom Imports
import { Link, NavLink } from 'react-router-dom';

function Header() {
  return (
   <nav className="header-container">



      <div>

          <NavLink to="/" id="header-logo">
            <a href="#">SUPERTEAM</a> 
          </NavLink>

        <div>
          <NavLink to="/">
            <a href="#">Home</a> 
          </NavLink>
          <NavLink to="/team">
          <a href="#">Your Team</a> 
          </NavLink>
        </div>
      </div>

      <div>
        <Link to="/signin">
        <button>Sign in</button>
        </Link>
        <Link to="/signup">
        <button>Sign up</button>
        </Link>
      </div>
      {/* <a href="#">Battle</a> |
      <a href="#">Add a Hero</a> */}

   </nav>
  );
}

export default Header;
